script: |
  super -f text -I q7468.spq | sort > q7468.out

inputs:
  - name: q7468.spq
    data: |
      SELECT DISTINCT - 17 + 42 * + col0 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT NULL IS NOT NULL OR - ( + 95 ) * + col1 + - CAST ( - col1 AS INTEGER ) <> + col0 * col1;
  - name: tab1

outputs:
  - name: q7468.out
    data: |
      2125
      3553
      3805
